import React, { Component } from 'react';
import './Styles/Slider.css'

const sliderLinks = [ './Images/slider1.jpg', 
                        './Images/slider2.jpg', 
                        './Images/slider3.jpg', 
                        './Images/slider4.jpg', 
                        './Images/slider5.jpg']

class Slider extends Component {
    render() {
        return (
            <img src={sliderLinks[0]}/>
        );    
    }
}



export default Slider;
